import Vue from 'vue';
import Router from 'vue-router';
import SignupForm from '../components/SignupForm.vue';

Vue.use(Router);

export default new Router({
  mode: 'history',
  routes: [
    {
      path: '/signup',
      name: 'Signup',
      component: SignupForm
    },
    {
      path: '/',
      redirect: '/signup'  // Redirect root to signup
    }
  ]
});
